import React from "react";

function Navbar() {
  return (
    <nav>
      <div className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
          <a class="navbar-brand" href="#">
            Holiday
          </a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
